function Educationals( { techArray }) {
    return (
        <section className="techBlurbsSection">
            {
            techArray.map((tech) => 
                <div className="blurb">
                    <img src={tech.img} alt={tech.altText}></img>
                    <h5>{tech.name}</h5>
                    <p>{tech.description}</p>
                    <input type={"button"} value="See Degrees" />
                </div>
                )
            }
        </section>
        )
}

export { Educationals }
